import React, { Component } from "react";

export default class Menu extends Component {
	constructor (props) {
		super(props)
	}

	render (){
		return(
			<div className="flex-1">
				<ul className="menu menu-horizontal p-0 text-slate-400">
					<li>{this.props.menus.menu}</li>
				</ul>
			</div>
		)
		
		
	}
}
